import React from "react";
import { Route, Routes, Link } from "react-router-dom";
import RoutePath from "../router/RoutePath";

const Home = () => {
  return (
    <div>
      <RoutePath />
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
      </ul>
    </div>
  );
};

export default Home;
